import React from "react";

import {TasksFilterAll,TasksFilterCompleted,TasksFilterActive,TasksFilterClear} from "./TasksFilter";



const Footer = ({activeItem,onClearCompleted,onActiveVision,classNames}) => {

    return (
        <footer className="footer">
            <span className="todo-count">{activeItem} items left</span>
            <ul className="filters">
                <TasksFilterAll
                    className = 'selected'/>
                <TasksFilterActive
                    className ={classNames}
                    onActiveVision={onActiveVision}
                />
                <TasksFilterCompleted
                    label = "Completed"/>
            </ul>
        <TasksFilterClear
                className = "clear-completed"
                label = "Clear completed"
                onClearCompleted={onClearCompleted}/>
         </footer>
    );
};

export default Footer;
